export const addDataCart = item => {
  return {
    type: "ADD_DATA",
    payload: item
  };
};

export const deleteDataCart = items => {
  return {
    type: "DELETE_DATA",
    payload: items
  };
};

export default function cartDataReducer(state = [], action) {
  switch (action.type) {
    case "ADD_DATA":
      return { ...state, 0: [action.payload] };
    case "DELETE_DATA":
      return { 0: [action.payload] };

    default:
      return state;
  }
}
